import React from 'react';
import ReactDOM from 'react-dom';
import {checkUserLoggedIn} from './Utils.js';
import {
	BrowserRouter as Router,
	Switch,
	Redirect,
	Route,
	NavLink,
	useRouteMatch,
	Link
  } from "react-router-dom";
import axios from "axios";

class List extends React.Component{

	state = {
		users: []
	}

	componentDidMount() {
		axios.get("http://192.168.100.7/api/register.php?action=userslist")
		  .then(res => {
			const users = res.data.data.user_detail;
			this.setState({ users });
		  })
	  }	

	  render() {
		if(!checkUserLoggedIn()){
			return <Redirect to='/login' />
		}		  
		return (
		  <ul>
			{ this.state.users.map(user => <li key="{user.id}"><b>{user.id}.</b>{user.email_address}</li>)}
		  </ul>
		)
	  }

}

export default List;
